import styled from "styled-components";

const Container = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    width: 50%;
`;

const Head = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
`;

const Title = styled.h1`
    font-family: "DM Sans", serif;
`;




const SignUp = () => {
    <Container>
        <Head>
            <Title>SignUp</Title>
        </Head>
    </Container>    
}

export default SignUp;
